import React from 'react';

const App = () => {
  const movie = ['Before Sunrise', 'Before Sunset', 'Before Midnight'];
  return (
    <ul>
      {movie.map((filme) => (
        <li key={filme}>{filme}</li>
      ))}
    </ul>
  );
};


export default App;
